        <div className="dib bg-pink ma3 pa3 shadow=5 br3 grow-4" style={{width:"50%"}}>
        <h1>{episode_id}</h1>
        <br></br>
        <p>Director: {director}</p>   
        <p>Opening: {opening_crawl}</p>   
        <p>starships: {starships}</p>       
        </div>
    )
};

export default DisplayFilms
